import logo from './logo.svg';
import './App.css';
import { Button, Card } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';

function App() {
  return (
    <div className="App">
      <Card className="text-center">
        <Card.Body>
          <Card.Title>
            <p>Free</p>
            <p><span><h1>$0/</h1></span>/month</p>
          </Card.Title>
          <Card.Text>
            <ul>
              <li>One</li>
              <li>One</li>
              <li>One</li>
              <li>One</li>
            </ul>
          </Card.Text>
          <Button variant="primary">Go somewhere</Button>
        </Card.Body>
      </Card>
    </div>
  );
}

export default App;
